/**
 * 保存提交过来的图片
 *@param $savepath  string  保存图片的路径 不是全路径
 *@param $img       stiring base64图片实体，含base64图片头
 *@return           array
 *@author jorsh20151106
 **/
function saveFormUpload($savepath, $img, $types = array())
{
    $basedir = '/uploads/' . $savepath;
    $fullpath = dirname('./') . $basedir;
    if (! is_dir($fullpath)) {
        mkdir($fullpath, 0777, true);
    }
    $types = empty($types) ? array(
        'jpg',
        'gif',
        'png',
        'jpeg'
    ) : $types;
    $img = str_replace(array(
        '_',
        '-'
    ), array(
        '/',
        '+'
    ), $img);
    $b64img = substr($img, 0, 100);
    if (preg_match('/^(data:\s*image\/(\w+);base64,)/', $b64img, $matches)) {
        $type = $matches[2];
        if (! in_array($type, $types)) {
            return array(
                'error' => 1,
                'msg' => 'image format is worng.',
                'url' => ''
            );
        }
        $img = str_replace($matches[1], '', $img);
        $img = base64_decode($img);
        $photo = '/' . md5(date('YmdHis') . rand(1000, 9999)) . '.' . $type;
        file_put_contents($fullpath . $photo, $img);
        return array(
            'error' => 0,
            'msg' => 'save sccuess',
            'url' => $basedir . $photo
        );
    }
    return array(
        'error' => 2,
        'msg' => 'please upload image',
        'url' => ''
    );
}  
